import React from 'react';
import './section.scss';

interface SectionProps {
    image: string;
    headline: string;
    text: string;
    flip: boolean;
    forumLink: string;
    videoLink: string;
}

const Section: React.FC<SectionProps> = ({ image, headline, text, flip, forumLink, videoLink }) => {
    return (
        <div className={`c-section ${flip ? 'c-section--reverse' : ''}`}>
            <div className={`c-section__image-wrapper`}>
                <img src={image} alt="section__image" />
            </div>
            <div className={'c-section__content'}>
                <h2>{headline}</h2>
                <p>{text}</p>
            </div>
        </div>
    )
}

export default Section;
